import React, { useState } from 'react';
import axios from 'axios';

import ConnectionForm    from './components/ConnectionForm';
import DatabaseSelector  from './components/DatabaseSelector';
import TableSelector     from './components/TableSelector';
import TablePreview      from './components/TablePreview';
import ColumnClassifier  from './components/ColumnClassifier';
import FakeTableViewer   from './components/FakeTableViewer';

import './App.css';

const API_URL = process.env.REACT_APP_API_URL || 'http://localhost:8080';

export default function App() {
  const [step, setStep]           = useState(1);
  const [conn, setConn]           = useState(null);
  const [databases, setDatabases] = useState([]);
  const [tables, setTables]       = useState([]);
  const [previewData, setPreviewData] = useState([]);
  const [columns, setColumns]     = useState([]);
  const [fakeData, setFakeData]   = useState([]);
  const [ctx, setCtx]             = useState({}); 
  // ctx will hold { database, table, totalRows, classification }

  // --- Helpers for stepping around ---
  const restartApp = () => {
    setStep(1);
    setConn(null);
    setDatabases([]);
    setTables([]);
    setPreviewData([]);
    setColumns([]);
    setFakeData([]);
    setCtx({});
  };

  const toTableSelector = () => {
    setPreviewData([]);
    setStep(3);
  };

  // --- Step 1: Connect & fetch databases ---
  const handleConnect = async (props) => {
    try {
      const res = await axios.post(
        `${API_URL}/api/connect/databases`,
        props
      );
      setDatabases(res.data);
      setConn(props);
      setStep(2);
    } catch (e) {
      alert('Connection failed: ' + e.message);
    }
  };

  // --- Step 2: Select database & fetch tables ---
  const handleSelectDb = async (db) => {
    try {
      const res = await axios.post(
        `${API_URL}/api/${encodeURIComponent(db)}/tables`,
        conn
      );
      setTables(res.data);
      setCtx(c => ({ ...c, database: db }));
      setStep(3);
    } catch (e) {
      alert('Load tables failed: ' + e.message);
    }
  };

  // --- Step 3: Select table & Preview page ---
  const handlePreviewTable = async (table) => {
    if (!table) return;
    try {
      const res = await axios.post(
        `${API_URL}/api/${encodeURIComponent(ctx.database)}/tables/${encodeURIComponent(table)}/preview?limit=10`,
        conn
      );
      setPreviewData(res.data);
      setCtx(c => ({ ...c, table }));
      setStep(4);
    } catch (e) {
      alert('Preview failed: ' + e.message);
    }
  };

  // --- Step 4: From Preview → Classify Columns page ---
  const handleClassifyColumns = async () => {
    try {
      // fetch total row count
      const countRes = await axios.post(
        `${API_URL}/api/${encodeURIComponent(ctx.database)}/tables/${encodeURIComponent(ctx.table)}/count`,
        conn
      );
      const totalRows = countRes.data;

      // fetch classification suggestions
      const classifyRes = await axios.post(
        `${API_URL}/api/${encodeURIComponent(ctx.database)}/${encodeURIComponent(ctx.table)}/classify`,
        {
          connection: conn,
          sampleSize: 10,
          overrides: {}
        }
      );

      setColumns(classifyRes.data);
      setCtx(c => ({ ...c, totalRows }));
      setStep(5);
    } catch (e) {
      alert('Classification failed: ' + e.message);
    }
  };

  // --- Step 5: After confirm → Generate Fake Data → Step 6 ---
  const handleClassificationComplete = async (classification) => {
    try {
      const res = await axios.post(
        `${API_URL}/api/${encodeURIComponent(ctx.database)}/${encodeURIComponent(ctx.table)}/fake`,
        {
          connection: conn,
          rowCount: ctx.totalRows,
          columns: classification.reduce((map, c) => {
            map[c.columnName] = { type: c.suggestion };
            return map;
          }, {})
        }
      );
      setFakeData(res.data);
      setCtx(c => ({ ...c, classification }));
      setStep(6);
    } catch (e) {
      alert('Fake-data generation failed: ' + e.message);
    }
  };

  return (
    <div className="app-container">
      {step === 1 && (
        <ConnectionForm onConnect={handleConnect} />
      )}

      {step === 2 && (
        <DatabaseSelector
          databases={databases}
          onSelectDb={handleSelectDb}
          onBack={restartApp}
        />
      )}

      {step === 3 && (
        <TableSelector
          tables={tables}
          onPreviewTable={handlePreviewTable}
          onBack={() => setStep(2)}
        />
      )}

      {step === 4 && (
        <TablePreview
          previewData={previewData}
          onClassify={handleClassifyColumns}
          onBack={toTableSelector}
        />
      )}

      {step === 5 && (
        <ColumnClassifier
          previewData={previewData}
          columns={columns}
          onComplete={handleClassificationComplete}
          onBack={() => setStep(4)}
        />
      )}

      {step === 6 && (
        <FakeTableViewer
          data={fakeData}
          onRegenerate={() =>
            handleClassificationComplete(ctx.classification)
          }
          onRestart={toTableSelector}
        />
      )}
    </div>
  );
}
